#print $JournaliniText;
sub SortedJournalNamesDB{

  my %Journalini;
  my @Journalini=();
  while($JournaliniText=~m/<pt>(.*?)<\/pt>/g){
    $Journalini{$1}="";
      push (@Journalini, $1);
    }
  my @SortedJournalini =  map { $_->[0] } sort { $b->[1] <=> $a->[1] } map { [ $_, length($_) ] } @Journalini;

  return \@SortedJournalini;
}


return 1;